import React, { useState } from 'react';

function ContactF() {
  const [fullName, setFullName] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [email, setEmail] = useState('');
  const [notes, setNotes] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!fullName || !phoneNumber || !email) {
      alert('Please fill out all required fields.');
      return;
    }

    // Submit the form data to your server
    console.log('Form data:', { fullName, phoneNumber, email, notes });
  };

  return (
    <form class="max-w-md mx-auto mt-8">
  <div class="mb-6">
    <label class="block text-gray-700 font-bold mb-2" for="name">
      Name
    </label>
    <input class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
      id="name" type="text" placeholder="Enter your name" />
  </div>
  <div class="mb-6">
    <label class="block text-gray-700 font-bold mb-2" for="email">
      Email
    </label>
    <input class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
      id="email" type="email" placeholder="Enter your email" />
  </div>
  <div class="mb-6">
    <label class="block text-gray-700 font-bold mb-2" for="phone">
      Phone
    </label>
    <input class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
      id="phone" type="tel" placeholder="Enter your phone number" />
  </div>
  <div class="mb-6">
    <label class="block text-gray-700 font-bold mb-2" for="message">
      Message
    </label>
    <textarea class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
      id="message" rows="5" placeholder="Enter your message"></textarea>
  </div>
  <div class="flex justify-center">
    <button class="bg-gray-900 hover:bg-gray-800 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
      type="button">
      Send
    </button>
  </div>
</form>

  );
}

export default ContactF;
